import { Box, Container, Typography } from "@mui/material";

const Home = () => {
  return (
    <>
      <Container sx={{ width: "100%" }}>
        <Box my={3} bgcolor="lightgrey">
          <Typography variant="h4">Section 1</Typography>
          {/* Section 1 contents */}
        </Box>

        <Box my={3} p={2} bgcolor="lightblue">
          <Typography variant="h4">Section 2</Typography>
          {/* Section 2 contents */}
        </Box>

        <Box my={3} p={2} bgcolor="lightgreen">
          <Typography variant="h4">Section 3</Typography>
          {/* Section 3 contents */}
        </Box>
      </Container>
    </>
  );
};

export default Home;
